import React from 'react';
import styles from './About.module.scss';

const { container, content, textWrapper, p, h2 } = styles;

const About = () => {
  return (
    <div className={container}>
      <div className={content}>
        <div className={textWrapper}>
          <h2 className={h2}>About Me</h2>
          <h3>On the personal notes</h3>
          <p className={paragraph}>
            My name is Sigrún Dís Hauksdóttir and I am from Reykjavík, the
            capital of Iceland. Currently I live in Odense, Denmark studying for
            my master’s degree. I have really wide interests, from sitting in a
            relaxed environment doing something creative to attending outdoor
            activities which increases the adrenaline. I am adventurous person
            who loves to travel, practise sports, and one of the most fun things
            I do is snowboarding. I am also really social, therefore I love
            working in a team consisting of diverse people. When it comes to
            planning something for social life I am often quick to volunteer
            because I find it really entertaining.
          </p>
        </div>
      </div>
    </div>
  );
};

export default About;
